        private static string ReminderCheckFileName = Path.Combine(ExceptionHelper.LogDirectory, "LastReminderCheck.txt");
        public static DateTime? LastReminderCheck
        {
            get
            {
                var result = ExceptionHelper.ReadFile(ReminderCheckFileName);
                DateTime? lastReminder = string.IsNullOrEmpty(result) ? (DateTime?)null : DateTime.Parse(result);
                
                return lastReminder;
            }
            set
            {
                ExceptionHelper.WriteFile(value.ToString(), ReminderCheckFileName, false);
            }
        }
